import './WhatWeDo.css';

import { Container } from "react-bootstrap";

function WhatWeDo(){
    return(
        <Container fluid>
            <Container>
                <div className = "whatwedo border">
                    <p>What we do</p>
                    <h1>Our Services For Your Business</h1>
                </div>
            </Container>
        </Container>
    )
}

export default WhatWeDo
